import React from 'react';
import './index.css';
import "@fontsource/odibee-sans";

//#region NAVBAR__CONTENT
const NAVBAR__LOGIC = () => {
  const [show, setShow] = React.useState(false);

  return (
  <header>
    <div className='fixed w-full h-11 md:h-14 items-center grid grid-cols-2 md:grid-cols-3'>
      <div className='flex justify-center text-2xl md:text-2xl italic decoration-2 navitem__home'><a className='bg-white-500' href="/">Home</a></div>
        <div className='items-center justify-end md:justify-center flex md:center navbar__container'>
          {/* NAVBAR FOR MOBILE */}
          <nav className=''>
            <button className='translate-y-1 top-2 mr-5 md:hidden ' id="hamburger" onClick={()=>setShow(!show)}>
              <div className='bg-white mb-1.5 w-7 h-1 rounded-md'></div>
              <div className='bg-white mb-1.5 w-7 h-1 rounded-md'></div>
              <div className='bg-white w-7 h-1 rounded-md'></div>
            </button>
            {show?<div className=' backdrop-blur-lg bg-white bg-opacity-5 w-full right-0 mt-2 absolute justify-center items-center justify-items-center flex' id="nav-ul">
              <ul className='w-32'>
              <li className='mt-2'>
              <div className='justify-center items-center justify-items-center flex text-xl bg-transparent'><a href="/">About Me</a></div>
              </li>
              <li className='mt-5'>
              <div className='justify-center items-center justify-items-center flex text-xl bg-transparent'><a href="/">Projects</a></div>
              </li>
              <li className='mt-5 mb-2'>
              <div className='justify-center items-center justify-items-center flex text-xl bg-transparent'><a href="/">Contact</a></div> 
              </li>
            </ul>
            </div>:null}
          </nav>

          {/* NAVBAR FOR DESKTOP */}
          <NAVBAR__DESKTOP />
      </div>
    </div> 
  </header>);
}

const NAVBAR__DESKTOP = () => {
  return (
    <nav className='hidden md:grid grid-cols-3 w-full'>
      <div className='flex justify-center md:text-2xl'><a href="/">About</a></div>       
      <div className='flex justify-center navitem__b'><a href="/">Projects</a></div>  
      <div className='flex justify-center navitem__b'><a href="/">Contact</a></div> 
    </nav>
  );
}

class NAVBAR extends React.Component {
  render() {
    return (
      <NAVBAR__LOGIC />
    );
  }
}
//#endregion NAVBAR__CONTENT

class BODY__CONTENT extends React.Component {
  render() {
    return (
      <div className='border h-96'>

      </div>
    );
  }
}

function App() {
  return (
    <div className="App">
      <NAVBAR />
      <BODY__CONTENT />
    </div>
  );
}

export default App;
